    false,nt"url": null,nt"notes": "The Satellite View of Hawaii map layer
    is a 100-meter resolution simulated natural-color image of Hawaii. Vegetation is
    generally green, with forests in darker green and grasslands or shrublands in lighter
    green. Areas of high reflectance, including urban areas, rock, and dry bare soil,
    are shown in shades of tan and pink. Very bright areas, such as snow and ice, are
    light blue. The image was produced by mosaicking Landsat Thematic Mapper (TM) imagery
    from the Landsat 4 and Landsat 5 satellites. Bands 7 (mid-infrared), 4 (near-infrared)
    and 2 (green), were assigned to red, green, and blue, respectively, and adjusted
    to produce the final simulated natural-color image.",nt"license_title": null,nt"extras":
